/* since converted image creates a .c file with 4 giant arrays
Always use the second array, since 16-bit like  VGA
Every two elements of the array corresponds to one pixel
read an element, LSR it by 8 spaces, then add the next element of the array to get the colour for one pixel
 ---> my draw_sprite function where I have colour = (colour_array[colour_index + 1] << 8) + colour_array[colour_index];
*/
void draw_sprite(int x_og, int y_og, int x_sz, int y_sz, const short int colour_array[]){
    int y_cd, x_cd;
    short int cl; 
    int idx = 0;
    
    for (x_cd = x_og; x_cd < x_sz + x_og; x_cd = x_cd + 1) {
        for (y_cd = y_og; y_cd < y_sz + y_og; y_cd = y_cd + 1) {
			if (colour_array[idx] != 0xff && colour_array[idx] != 0xf7) cl = (colour_array[idx + 1] << 8) + colour_array[idx];
			else cl == 0x00000;
            
            if(y_cd >= 0 && y_cd <= 305 && x_cd >= 15 && x_cd <= 225 && cl != 0) {
				plot_pixel(y_cd, x_cd, cl);
            }
			//plot_pixel(y_cd, x_cd, cl);
            idx = idx + 2;
        }
    }
}



