void draw_word(int word[5][5], int color, int locx, int locy, int sf){
	for (int i = 0; i < 5; i ++){
		for (int j = 0; j < 5; j ++){
			if (word[i][j]==1){
				plot_pixel(locy + (sf * j),locx + (sf * i),color);
			}
		}
	}
}
void draw_img(int word[5][5], int color, int locx, int locy, int sf){
	for (int i = 0; i < 5; i ++){
		for (int j = 0; j < 5; j ++){
			if (word[i][j]==1){
				draw_box(locy + (sf * j),locx + (sf * i),color);
			}
		}
	}
}

void draw_box(int x, int y, int color){
	for (int i = x - 2; i < x + 3; i++){ // draw 5 x 5 box
		for (int j = y - 2; j < y + 3; j++){
			plot_pixel(i,j,color);
		}
	}
}



	